import React, { Component } from 'react';
import { connect } from 'react-redux'
import { getLogs } from '../actions'


const LogShow = () => {
  return (
  <div className="card-container">
    <div className="ui card">
      <div className="content">
        <p>Date</p>
        <h4 id="title">Title</h4>
          <ul>
            <li>Goals I accomplished today: </li>
            <li>What I learned: </li>
            <li>What I don't understand: </li>
            <li>Goals for tomorrow: </li>
          </ul>
      </div>
      <div>
        <i className={`big smile outline icon`}></i>
        <button>Delete</button>
        <button>Edit</button>
      </div>
    </div>
  </div>
  )
}

const mapStateToProps = state => {
  return {
    logs: state.logReducer.logs,
    loading: state.logReducer.loading
  }
}

export default connect(mapStateToProps, {getLogs})(LogShow);
